import React from 'react'
import { Api } from '../../API/Api'
import { endPoints } from '../../API/Endpoint'
import { REMOVE_FROM_WISHLIST } from '../ActionType'
import { GET_WISHLIST } from '../ActionType'
const Remove_To_Wishlist_Action = (dispatch, reqpayload) => {
    Api.post(endPoints.REMOVE_FROM_WISHLIST, reqpayload).then((res) => {
        Api.post(endPoints.GET_WISHLIST, reqpayload).then((res) => {
            console.log(res.data.data)

            dispatch({
                type: GET_WISHLIST,
                payload: res.data.data
            })
        }).catch((err) => console.log(err))

    }).catch((err) => console.log(err))
}

